import { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";
import DataService from "./services/data.service";

const  App = () =>  {
  const temp: any = [];
  const [tableData, setTableData] = useState(temp);
  const [loading, setLoading] = useState(true);
  const [visible, setVisible] = useState(false);

  const getData = () => {
    setVisible(true);
    setLoading(true);
    DataService.getAll("http://algotraders.pythonanywhere.com/webDev/")
    .then(response => {
      console.log(response);
     setTableData(response);
     setLoading(false);
    })
    .catch(e => {
      console.log(e);
    });
}


  return (
    <div className="App">
      <button onClick={() => getData()}>Load Data</button>
    { visible &&  <table>
        {loading ? (
          <div>Loading</div>
        ) : (
          tableData.Matrix.map((dataArray: any, i: number) => {
            return (
              <tr>
                {dataArray.map((number: number, j: number) => {
                  return (
                    <td>
                      {(
                        number / tableData.constant
                      ).toPrecision(2)}
                    </td>
                  );
                })}
              </tr>
            );
          })
        )}
      </table> }
    </div>
  );
}

export default App;
